import './App.css';
import { Outlet } from "react-router-dom";
import 'animate.css';

import React from 'react';
import LanguageSelector from './Lang/LanguageSelector';
import MyComponent from './MyComponent';
import CountDown from './Layout/Countdown';


const App = () => {
  return (
    <>
      <div className='App'>

      <LanguageSelector />
      <MyComponent />
      <CountDown/>

        <Outlet />
      </div>
    </>
  );
};

export default App;
